package com.lixm.notes.kotlininterface A{    fun foo(){        print("A")    }    fun bar()}interface B1{    fun foo(){        print("B")    }    fun bar(){        print("bar")    }}class C : A{    override fun bar() {        print("bar")    }}class D : A,B1{    override fun foo() {        super<A>.foo()        super<B1>.foo()    }    override fun bar() {        super<B1>.bar()    }}